import React, { Component } from 'react';

export class Home extends Component {
  static displayName = Home.name;

  render () {
    return (
      <div>
            <h2>Hello, This is Shweta Dalal!<br />
                <br /> </h2>
            <p>I am currently pursuing Masters in Computing and Data Anaytics at SMU.
            I joined MCDA since I am interested in Data Analytics and have previous work experience in it.
            I also want to explore Software Development field. Looking forward to learn at SMU!</p>
        
        <p>The <code>ClientApp</code> subdirectory is a standard React application based on the <code>create-react-app</code> template. If you open a command prompt in that directory, you can run <code>npm</code> commands such as <code>npm test</code> or <code>npm install</code>.</p>
      </div>
    );
  }
}
